import React from 'react';
import NavBar from '../NavBar';
import Footer from '../Footer';
import Card from 'react-bootstrap/Card'
import { Container, Row, Col } from 'react-bootstrap';





function AdoptableCat(){
    let cats = [
        {
            "name":"Molly",
            "image":"https://images.pexels.com/photos/1056251/pexels-photo-1056251.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1",
            "breed":"Domestic",
            "age":"4 years",
            "sex":"male"
        },
        {
            "name":"Holly",
            "image":"https://images.pexels.com/photos/3777622/pexels-photo-3777622.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },
        {
            "name":"Dolly",
            "image":"https://images.pexels.com/photos/3777622/pexels-photo-3777622.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },
        {
            "name":"Lolly",
            "image":"https://images.pexels.com/photos/3777622/pexels-photo-3777622.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
        },

    ]


    return (
    <div>
    <NavBar/>
    <div><img className="firstImage" src="https://images.pexels.com/photos/774731/pexels-photo-774731.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"/></div>
        <header className="adopt-cat-title"><h1>Adoptable Cats</h1></header>
        <div className="adopt-cat-text">Meet our adoptable cats! All these cats have been rescued and are ready to join your family. 
</div>
<div className="adopt-cat-cards">
<p>All of these cats are individuals and have their own stories, interests, and personalities. Please read their bios and browse their photos and let us know if we can help you find the one that’s right for you. All of our cats have been given a comprehensive exam by a veterinarian. They have been vaccinated, neutered or spayed, FIV/Felv, and microchipped. Any additional medical info is listed in their bios.</p>
<Row xs={1} md={3} className="g-4">
  {cats.map((cat, idx) => (
    <Col>
      <Card>
        <Card.Img variant="top" src={cat.image} />
        <Card.Body>
          <Card.Title>{cat.name}</Card.Title>
          <Card.Text>Breed:{cat.breed}</Card.Text>
          <Card.Text>Age:{cat.age}</Card.Text>
          <Card.Text>Sex:{cat.sex}</Card.Text>

        </Card.Body>
      </Card>
    </Col>
  ))}
</Row>

</div>
<div className="adoption-process"><h1>
    Adoption Process
</h1>
<p>Our adoption process is people friendly and we welcome the opportunity to work with people looking to adopt. Our adoption process consists of a short application and a meet where you can get to know the animal you are interested in. Once you find the perfect match, we ask adopters to sign an adoption contract and give a donation to help us rescue the next animal in need. We process applications in the order in which they were received. By providing comprehensive behavioral information about the animal and gathering relevant information about the prospective home environment, we work with each applicant to match them with a compatible animal.</p></div>

        <Footer/>

    </div>
    )
}
export default AdoptableCat;
